											AJO - корма для собак и кошек нового поколения, созданные в ключе HOLISTIC VIEW.<br>
 Этот подход основан на знаниях о физиологических потребностях животных и современных исследований питания.<br>
<h2>Особенности кормов AJO:</h2>
<ul class="article-list">
	<li>Белки животного происхождения: курица, индейка, утка, свинина.</li>
	<li>
	Источники углеводов-гречка, рис, овсяные хлопья и картофель.</li>
	<li>
	Антиоксиданты: витамин С,витамин Е, ß-каротин и лютеин.</li>
	<li>
	Клетчатка овощей и фруктов.</li>
	<li>
	Смесь животных жиров и лососевый жир. Источник Омега 3.</li>
	<li>
	Витамины и минералы.</li>
	<li>
	Пробиотики Bacillus subtillis, Bacillus licheniformis.</li>
	<li>
	Пребиотики-инулин.</li>
	<li>
	Экстракт юкки Шидигера.</li>
	<li>
	Хондропротекторы в рационе для собак.</li>
</ul>
 <br>
 Корма упакованы в пакеты с 3-х слойной пленкой для защиты от уф-лучшей. Пакеты снабжены зип локами или липучкой, которые удобно хранить.<br>						</div>






